import React from 'react';
import './ShopHome.styles.scss'
import Directory from '../shop.components/directory/directory.component'
import {withRouter} from ''

const ShopHome = () => {


    const ShopSection = () => {
        return(
            <div className = "shophome">
                <Directory />
            </div>
        )
    }

    const Ramen = ({history}) => {
        return(
            <div>
                <h1>Ramen</h1>
                <ShopList />
            </div>
        )
    }

    return(
        <div >
            <Switch>
                <Route exact path='/shop' component={ShopSection} />
                <Route exact path='/shop/Ramen' component={Ramen} />
                <Redirect to='/home' />
            </Switch>
        </div>
    )
}

export default ShopHome
